"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Adkins JC and Noble S, &ldquo;Tiagabine. A Review of Its Pharmacodynamic and Pharmacokinetic Properties and Therapeutic Potential in the Management of Epilepsy,&rdquo;",
"      <i>",
"       Drugs",
"      </i>",
"      , 1998, 55(3):437-60.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?26/22/26982/abstract-text/9530548/pubmed\" id=\"9530548\" target=\"_blank\">",
"        9530548",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
