var title_f26_22_26988="Inotropic drugs";
var content_f26_22_26988=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76583&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76583&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Inotropic infusions used for management of a potential pediatric organ donor",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Milrinone",
"         </strong>",
"        </p>",
"        <p>",
"         (Primacor&reg;)",
"        </p>",
"       </td>",
"       <td>",
"        0.25-0.75 mcg/kg/min IV",
"       </td>",
"       <td>",
"        <p>",
"         Loading dose: 50 mcg/kg",
"        </p>",
"        <p>",
"         Hypotension can occur",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Dopamine",
"        </strong>",
"       </td>",
"       <td>",
"        2-20 mcg/kg/min IV",
"       </td>",
"       <td>",
"        Titrate to desired blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Dobutamine",
"         </strong>",
"        </p>",
"        <p>",
"         (Dobutrex&reg;)",
"        </p>",
"       </td>",
"       <td>",
"        2-20 mcg/kg/min IV",
"       </td>",
"       <td>",
"        Titrate to desired blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Epinephrine",
"        </strong>",
"       </td>",
"       <td>",
"        0.1-1 mcg/kg/min IV",
"       </td>",
"       <td>",
"        Titrate to desired blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Norepinephrine",
"         </strong>",
"        </p>",
"        <p>",
"         (Levophed&reg;)",
"        </p>",
"       </td>",
"       <td>",
"        0.05-2 mcg/kg/min IV",
"       </td>",
"       <td>",
"        Titrate to desired blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Phenylephrine",
"         </strong>",
"        </p>",
"        <p>",
"         (Neo-Synephrine&reg;)",
"        </p>",
"       </td>",
"       <td>",
"        0.1-0.5 mcg/kg/min IV",
"       </td>",
"       <td>",
"        <p>",
"         Bolus: 5-20 mcg/kg",
"        </p>",
"        <p>",
"         Titrate to desired blood pressure",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Vasopressin",
"         </strong>",
"        </p>",
"        <p>",
"         (Pitressin&reg;)",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         0.3-2 milli-units/kg/min IV",
"        </p>",
"        <p>",
"         <strong>",
"          Note: Dosing is different for treatment of diabetes insipidus",
"         </strong>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Limited data in children",
"        </p>",
"        <p>",
"         Not recommended as first line therapy",
"        </p>",
"        <p>",
"         Titrate to desired blood pressure",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        Inotropic agents are used for low cardiac output states to improve end organ perfusion. These agents should be titrated to maintain a normal blood pressure for age. Blood pressure alone does not indicate adequate tissue perfusion. Serum biomarkers such as lactate should be followed as inotropic support is titrated.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Nakagawa, TA. Pediatric donor management guidelines. NATCO, The Organization for Transplant Professionals, 2008. p.5.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
